import { UserCard } from "./UserCard";

export const UserList = (props) => {
  if (props.users.length === 0) {
    return <h2>No User.</h2>;
  }

  return (
    <ul className="user-list">
      {props.users.map((user) => (
        <UserCard key={user.id} name={user.userName} age={user.userAge} />
      ))}
    </ul>
  );
};
